import React, { Component } from 'react';
import Typed from 'react-typed';

class Character extends Component {



    componentDidMount() {
        fetch("/api/2")
        .then(res => res.json())
        .then(characters => {
            console.log("Characters received..", characters)
        })
    }

    render() {
        return (
            <div>
                <h1>Character</h1>
            </div>
        )
    }


}

export default Character

